<h1 id="get-all-keys-from-dictionary">Get All Keys from Dictionary</h1>
<h2 id="notes">Notes</h2>
<p>Get all of the keys from a dictionary. ## Syntax</p>
<pre><code>keysFrom(dictionary: &lt;#Variable#&gt;)</code></pre>
<h2 id="example">Example</h2>
<pre><code>keysFrom(dictionary: Meta)</code></pre>
